import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

function Clicker(){
  function handleClick(e){
    alert('berhasil mengklik')

    e.preventDefault()
  }

  return (

    <a href="#" onClick={handleClick}> klik coba</a>

  )

}

class App extends Component{
  render() {
    return (
      <div className="App">
      <header className="App-header">
      <Clicker/>
         <img className="App-logo" src={logo} alt="ini logo"></img>
         </header>
         <Clicker/>
      </div>
    );
  }
}

export default App;
